import './DashboardContainer.css';
import AgentCard from '../AgentCard';

const imgClipboard = "http://localhost:3845/assets/ef6e5e33bf0c7a55016af261878a9906b26dd5b9.svg";
const imgClipboardIcon = "http://localhost:3845/assets/4dbbd987c8be6477898b3913e30b19bbae904744.svg";
const imgPerson = "http://localhost:3845/assets/dab477c6ade2d19b6d463e2d6994e32669d7440c.svg";
const imgEllipse1 = "http://localhost:3845/assets/dcc912ce11c40eac810e7d22fb275abb31670d4b.svg";
const imgEllipse2 = "http://localhost:3845/assets/94538a1e7a646e4519925df62f18476b373c5bee.svg";
const imgEllipse3 = "http://localhost:3845/assets/721109041c9a688b03535beb6d7d05ad3685a5fa.svg";

function DashboardContainer() {
  const agents = [
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse1 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse3 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse2 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse2 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse1 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse2 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse3 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse1 },
    { name: "Sarah Johnson", contactId: "1247685", specialization: "abc", totalCases: 1247, avatar: imgEllipse1 }
  ];

  return (
    <div className="dashboard-page">
      <div className="dashboard-container">
        <div className="dashboard-content">
          <div className="dashboard-header">
            <div className="clipboard-icon">
              <img src={imgClipboard} alt="" className="clipboard-base" />
              <img src={imgClipboardIcon} alt="" className="clipboard-icon-inner" />
            </div>
            <h2>Agents Dashboard</h2>
          </div>

          <div className="agents-grid">
            {agents.map((agent, index) => (
              <AgentCard key={index}>
                <div className="agent-info">
                  <div className="agent-avatar">
                    <img src={agent.avatar} alt="" className="avatar-bg" />
                    <img src={imgPerson} alt="" className="avatar-icon" />
                  </div>
                  <div className="agent-details">
                    <h3 className="agent-name">{agent.name}</h3>
                    <p className="agent-contact">Contact ID: {agent.contactId}</p>
                    <p className="agent-specialization"><span>Specialization:</span> {agent.specialization}</p>
                    <p className="agent-cases">Total Cases: {agent.totalCases}</p>
                  </div>
                </div>
              </AgentCard>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default DashboardContainer;
